def bellman(s, d, ed, n):
    if (s == d):
        return 0
    dis = [0] * (n + 1)
    for i in range(1, n + 1):
        dis[i] = inf
    dis[s] = 1
    for i in range(n - 1):
        for it in ed:
            dis[it[1]] = min(dis[it[1]], dis[it[0]] * ed[it])
    for it in ed:
        if (dis[it[1]] > dis[it[0]] * ed[it]):
            return -2
    if (dis[d] == inf):
        return -1
    else:
        return dis[d]


