    for i in range(R):
        for j in range(C):
            if (arr[i][j] == 1):
                Distance(arr, i, j)
    for i in range(R):
        for j in range(C):
            if (arr[i][j] == 1 and table[i][j] > max):
                max = table[i][j]
    if (max < INT_MAX):
        return max
    return -1


