class TreeNode:
    def __init__(self):
        self .parent = None
        self .children = []

    def addChild(self, node):
        self .children .append(node)

    def setParent(self, node):
        self .parent = node

    def getParent(self):
        return self .parent

    def computeScore(self):
        if (len(self .children) == 0):
            return 1
        res = 0
        for curr in self .children:
            res += curr .computeScore()
        if (self .parent is None):
            return res
        else:
            return 2 * res


