    oddCount = 0
    for x in hmap:
        if (hmap[x] % 2 != 0):
            oddCount += 1
            oddChar = x
    if (oddCount > 1 or oddCount == 1 and len(st) % 2 == 0):
        return "NO PALINDROME"
    firstHalf = ""
    secondHalf = ""
    for x in sorted(hmap .keys()):
        s = (hmap[x] // 2) * x
        firstHalf = firstHalf + s
        secondHalf = s + secondHalf
    if (oddCount == 1):
        return (firstHalf + oddChar + secondHalf)
    else:
        return (firstHalf + secondHalf)


