    while (safe > 0):
        p = safe & (-safe)
        col = (int)(math .log(p) / math .log(2))
        board[row][col] = 'Q'
        solveBoard(board, row + 1, rowmask | p, (ldmask p) << 1, (rdmask p) >> 1)
        safe = safe & (safe - 1)

    board[row][col] = ' '


