def getIndex(s, i):
    if s[i] != '[':
        return -1
    d = deque()
    for k in range(i, len(s)):
        if s[k] == '[':
            d .append(s[i])
        elif s[k] == ']':
            d .popleft()
        if not d:
            return k
    return -1


