    i = 0
    while (len(primes) and primes[i] * primes[i] <= N):
        if (N % primes[i] == 0):
            tmp = 0
            while (N % primes[i] == 0):
                tmp += 1
                N /= primes[i]
            max_count = max(max_count, tmp)
        i += 1
    if (max_count == 0):
        max_count = 1
    return max_count


