    num = 0
    for i in range(index1):
        num = num * 10 + (s[i] - '0')
    if (s[index1] % 2 == 0):
        num = num * 10 + (s[index1] - '0' + 2)
    else:
        num = num * 10 + (s[index1] - '0' + 1)
    for i in range(index1 + 1, len(s)):
        num = num * 10
    return num


