    sieve(prime, R)
    freq = [0] * 10
    for i in range(L, R + 1):
        if (not prime[i]):
            while (p):
                freq[p % 10] += 1
                p //= 10
    max = freq[0]
    ans = 0
    for j in range(1, 10):
        if (max <= freq[j]):
            max = freq[j]
            ans = j
    if max == 0
    return -1
    return ans


